import './NewEmployeeForm.css';

function NewEmployeeForm(){

    var body = {
        userName: 'Fred',
        userEmail: 'Flintstone@gmail.com'
    }

    axios({
        method: 'post',
        url: '/api',
        data: body
    })
    .then(function (response) {
        console.log(response);
    })
    .catch(function (error) {
        console.log(error);
    });

    return(
        <div className="new-employee-form">
            <form class="new-employee-form" method="post">
                <input type="text" class="new-employee-firstname" name="first_name" placeholder="First Name"/>
                <input type="text" class="new-employee-lastname" name="last_name" placeholder="Last Name"/>
                <input type="text" class="new-employee-emailaddress" name="email_address" placeholder="Email Address"/>
                <input type="text" class="new-employee-job" name="job" placeholder="Job"/>
                <button>add Employee</button>
            </form>
        </div>
    )
}

export default NewEmployeeForm
